&nbsp;
<h1 class="title style-scope ytd-video-primary-info-renderer">Deadreef the Ephemeral Fish Fury of Kairyu-Shin Deck White Aura Bihamut</h1>

Sadly I lost Destrudo, cloak, bulb and 1 Malicious which I all used to play in my Zombie combo deck. But the deck is still fine and is able to make really insane boards with tons of negates. Also we can easily make use of <a data-name="Dragon Buster Destruction Sword">Dragon Buster Destruction Sword</a> and preventing our opponent from summoning monster from the extra deck(Honestly I have no idea why Konami did not hit this card instead of destrudo). Anyway the typical board ends on <a data-name="Apollousa, Bow of the Goddess">Apollousa, Bow of the Goddess</a>, <a data-name="Naturia Exterio">Naturia Exterio</a>, <a data-name="i:p Masquerena">i:p Masquerena</a>, <a data-name="Union Carrier">Union Carrier</a>, <a data-name="Doomking">Doomking</a>(equipped with <a data-name="Dragon Buster Destruction Sword">Dragon Buster Destruction Sword</a>) and in some rare cases even<a data-name="El Shaddoll Winda"> El Shaddoll Winda</a> aswell. If you have any questions about the combos, ratios or anything feel free 2 leave a comment.

&nbsp;

<strong>Update: </strong>After the recent Deck profile from the youtubers "Crush-cards" I decided to throw in 3 <a data-name="Tuning">Tuning</a>, <a data-name="Satellite Synchron">Satellite Synchron</a> and <a data-name="Quickdraw Synchron">Quickdraw Synchron</a>, since I was already playing <a data-name="Jet Synchron">Jet Synchron</a> the engine fits perfectly with the deck.

Fun and quick deck. No counters or lockdowns, only pure fun!

Use Toy Vendor and Fusion Recycling Plant to discard cards to the graveyard and gain useful ones to your hand.

