<h1 class="title style-scope ytd-video-primary-info-renderer">Snowflower Saint Kanzashi Snowflower Saint Teardrop Deck Snowflower</h1>

gameplay of the deck :

&nbsp;

<a class="style-scope ytcp-video-metadata-info" href="https://youtu.be/u5wsmDRbOeg" target="_blank" rel="noopener noreferrer nofollow">https://youtu.be/u5wsmDRbOeg</a>

cycle through field spells to gain effects for the light and dark monsters within the deck and overwhelm your opponent with either powerful chaos boss monsters and/or the dream mirrors own boss monster Oneiros. The deck whilst fragile can become extremely deadly with the right set up leaving your opponents board at constant risk of removal or left with no way to go on the offensive against even the level 1 monsters of the deck using phantasms. The deck has its own in theme set rotation with hypnagogia which can be quite effectively used with traptrick to search it out and activated upon your opponent using their own field spell such as their 1 of diagram, orcust babel and a hard counter to mine and lair decks.

&nbsp;

Disclaimer: "apparently" within the toon chaos set there will be a chaos themed boss monster which was stated to fit right at home into dream mirror. As of this upload the card isnt known but when it is feel free to add it in how ever you see fit or I will upload a 2nd version of this deck, we'll see.
